import React from 'react';
import './Modal.css';

const Modal = ({ show, handleClose, message }) => {
    if (!show) {
        return null;
    }

    return (
        <div className="modal-main">
            <div className="modal">
                <h2>{message}</h2>
                <button onClick={handleClose}>Continue Shopping</button>
            </div>
        </div>
    );
}

export default Modal;
